import { Global } from "@emotion/react"

const Fonts = () => {
    <Global styles={
        `
            font-family: 'Interc';
            font-style: 'normal0;
            font-weight: 400;
            font-display: swap;
            src: url('./inter/Inter.ttf')
        `
    }/>
}


export default Fonts
